import Link from 'next/link';

let Logo = (props) => {
	console.log(props)
	return (
			<img src={props.src} alt={props.alt || ''}  width={props.width || "50"}/>
	)
}

let NavigationLink = () => {
	return (
		<div className="navbar-end">
			<Link href="/">
				<a className="navbar-item is-tab"> Home </a>
			</Link>

			<Link href="/about">
				<a className="navbar-item"> About </a>
			</Link>

			<Link href="/faqs">
				<a className="navbar-item"> FAQs </a>
			</Link>
		</div>
	);
}


let MainNavigation = () => {
	return (
		<nav className="navbar is-transparent">
			<div className="navbar-brand">
				<Link href="/">
					<a className="navbar-item">
						<Logo 
							src="/static/logo.svg"
							alt="App logo"
							width="120"
						/>
					</a>
				</Link>
				<div className="navbar-burger burger" data-target="mainNav">
			      <span></span>
			      <span></span>
			      <span></span>
			    </div>
			</div>

			<div id="mainNav" className="navbar-menu">
				<NavigationLink />
			</div>
		</nav>
	)
}

export default MainNavigation;
